<div>
    <div class="row">
        <div class="col-md-6">
            <div class="row py-3 border border-solid border-dark rounded mb-3">
                <div class="col-md-12">
                <label for="defaultFormControlInput" class="form-label">Motivo de consulta</label>
                <textarea readonly class="form-control" wire:model="motivo"></textarea>
                @error('motivo')
                <span class="badge rounded-pill bg-label-danger mt-2">El motivo es requerido</span>
                @enderror
                {{-- <div id="defaultFormControlHelp" class="form-text">We'll never share your details with anyone else.</div> --}}
                </div>
            </div>
            <div class="row py-3 border border-solid border-dark rounded mb-3">
                <h6>Antecedentes personales</h6>
                <div class="col-md-4">
                    <label for="defaultFormControlInput" class="form-label">Alérgicos</label>
                    <textarea readonly class="form-control" wire:model="alergicos"></textarea>
                </div>
                <div class="col-md-4">
                    <label for="defaultFormControlInput" class="form-label">Quirúrgicos</label>
                    <textarea readonly class="form-control" wire:model="quirurgicos"></textarea>
                </div>
                <div class="col-md-4">
                    <label for="defaultFormControlInput" class="form-label">Otros</label>
                    <textarea readonly class="form-control" wire:model="otros"></textarea>
                </div>
            </div>
            <div class="row py-3 border border-solid border-dark rounded mb-3">
                <h6>Examen Estomatologico</h6>
                <div class="col-md-6">
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Labios</label>
                        <input readonly type="text" class="form-control" wire:model="labios">
                    </div>
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Lengua</label>
                        <input readonly type="text" class="form-control" wire:model="lengua">
                    </div>
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Paladar</label>
                        <input readonly type="text" class="form-control" wire:model="paladar">
                    </div>
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Piso de Boca</label>
                        <input readonly type="text" class="form-control" wire:model="piso_boca">
                    </div>
                </div>
                <div class="col-md-6">
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Carrillos</label>
                        <input readonly type="text" class="form-control" wire:model="carrillos">
                    </div>
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Glandulas salivares</label>
                        <input readonly type="text" class="form-control" wire:model="glandulas_salivares">
                    </div>
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Maxilares</label>
                        <input readonly type="text" class="form-control" wire:model="maxilares">
                    </div>
                    <div>
                        <label for="defaultFormControlInput" class="form-label">Sistema glangionar</label>
                        <input readonly type="text" class="form-control" wire:model="sistema_glangionar">
                    </div>
                </div>
            </div>
            <div class="row py-3 border border-solid border-dark rounded mb-3">
                <h6>Diagnostico y Observaciones</h6>
                <div class="col-md-6">
                    <label for="defaultFormControlInput" class="form-label">Diagnostico principal</label>
                    <input readonly type="text" class="form-control" wire:model="diagnostico_principal">
                    @error('diagnostico_principal')
                    <span class="badge rounded-pill bg-label-danger mt-2">El diagnostico principal es requerido</span>
                    @enderror
                </div>
                <div class="col-md-6">
                    <label for="defaultFormControlInput" class="form-label">Observaciones</label>
                    <textarea readonly class="form-control" wire:model="observaciones"></textarea>
                    @error('observaciones')
                    <span class="badge rounded-pill bg-label-danger mt-2">La observacion es requerida</span>
                    @enderror
                </div>
            </div>
        </div>
        <div class="col-md-6">
